#define	PIXELSIZE2	2
#define	LINESIZE2	1024

#define PutPixelD(x,y,rv,gv,bv)	*(unsigned short*)(((char*)getVramDrawBuffer())+((x)*PIXELSIZE2)+((y)*LINESIZE2))=(unsigned short)((((((bv)>>3)&0x1F)<<10)+((((gv)>>3)&0x1F)<<5)+((((rv)>>3)&0x1F)<<0)+0x8000));

unsigned char	SolidKeyboard=0;

void PutPixel(int x,int y,unsigned char rv,unsigned char gv,unsigned char bv)
{
unsigned short color;
unsigned char	R,G,B;

//	if((x<60)||(x>=420))
	//	color=0;
	//else
	color=*(unsigned short*)(((char*)getVramDrawBuffer())+x*PIXELSIZE2+y*LINESIZE2);
	R=(unsigned char)(((((color>>0)&0x1F)<<3)>>2)+(rv>>1));
	G=(unsigned char)(((((color>>5)&0x1F)<<3)>>2)+(gv>>1));
	B=(unsigned char)(((((color>>10)&0x1F)<<3)>>2)+(bv>>1));
	PutPixelD(x,y,R,G,B);
}

