int GetKeyFromCode(int KeyCode)
{
int	a=0;

	if(KeyCode==AK_RET) return(SPECIAL_CODE_FOR_ENTER);	// Special Case
	while((AmigaKeyboard[a].AmigaKeyCode!=-1)&&(AmigaKeyboard[a].AmigaKeyCode!=KeyCode)) ++a;
return(a);
}

void DrawKeyboard(void)
{
int		a,x,y,cs,sy=0;
unsigned char	pv;
	if(KeyboardPosition==0) sy=KeyboardPositionOffset;
	for(a=0,y=sy;a<130;a++,y++)		// a=cntr
	{
		for(x=0;x<480;x++)
		{
			pv=AmigaKeyboardImage[a][x];
			PutPixel(x,y,pv,pv,pv);
		}
	}

	for(a=0;a<NOFSTICKYKEYS;a++)
	{
		if(AmigaStickyKeys[a].Sticky)
		{
			cs=GetKeyFromCode(AmigaStickyKeys[a].AmigaKeyCode);
			for(y=AmigaKeyboard[cs].y1;y<AmigaKeyboard[cs].y2;y++)
			{
				for(x=AmigaKeyboard[cs].x1;x<AmigaKeyboard[cs].x2;x++)
				{
					pv=AmigaKeyboardImage[y][x];
					PutPixel(x,(y+sy),pv,(pv>>1),(pv>>1));
				}
			}
		}
	}
	if(CurrentSelection!=SPECIAL_CODE_FOR_ENTER)
		DrawSquare(AmigaKeyboard[CurrentSelection].x1,AmigaKeyboard[CurrentSelection].y1,AmigaKeyboard[CurrentSelection].x2,AmigaKeyboard[CurrentSelection].y2);
	else
		DrawEnter();
}

