int PreSpec=0;

void HandleButtonChange(int Direction)	// 0-up, 1-right, 2-down, 3-left
{
int	PreSelect=CurrentSelection;

	switch(Direction)
	{
		case 1 :
			if(CurrentSelection==SPECIAL_CODE_FOR_ENTER)
			{
				if((PreSpec==AK_BS)||(PreSpec==AK_BACKSLASH)||(PreSpec==AK_RBRACKET)||(PreSpec==AK_NP7)) CurrentSelection=GetKeyFromCode(AK_NP7);
				if((PreSpec==AK_RSH)||(PreSpec==AK_QUOTE)||(PreSpec==AK_UP)) CurrentSelection=GetKeyFromCode(AK_UP);
				break;
			}
			switch(AmigaKeyboard[CurrentSelection].AmigaKeyCode)
			{
				case AK_QUOTE :
					CurrentSelection=GetKeyFromCode(AK_RET);PreSpec=AK_QUOTE;
				break;
				case AK_RBRACKET :
					CurrentSelection=GetKeyFromCode(AK_RET);PreSpec=AK_RBRACKET;
				break;
				case AK_NPDEL :
				case AK_NP3 :
					CurrentSelection=GetKeyFromCode(AK_ENT);PreSpec=AmigaKeyboard[CurrentSelection].AmigaKeyCode;
				break;
				default :
					++CurrentSelection;
					if(AmigaKeyboard[CurrentSelection].AmigaKeyCode==-1)
						--CurrentSelection;
					else
					{
						if(AmigaKeyboard[CurrentSelection].x1<AmigaKeyboard[CurrentSelection-1].x1) --CurrentSelection;
					}
				break;
			}
			if((AmigaKeyboard[CurrentSelection].AmigaKeyCode==AK_ENT)&&(CurrentSelection!=PreSelect)) PreSpec=AmigaKeyboard[PreSelect].AmigaKeyCode;
		break;
		case 3 :
			if(CurrentSelection==SPECIAL_CODE_FOR_ENTER)
			{
				if((PreSpec==AK_BS)||(PreSpec==AK_BACKSLASH)||(PreSpec==AK_NP7)||(PreSpec==AK_RBRACKET)) CurrentSelection=GetKeyFromCode(AK_RBRACKET);
				if((PreSpec==AK_RSH)||(PreSpec==AK_UP)||(PreSpec==AK_QUOTE)) CurrentSelection=GetKeyFromCode(AK_QUOTE);
				break;
			}
			switch(AmigaKeyboard[CurrentSelection].AmigaKeyCode)
			{
				case AK_UP :
					CurrentSelection=GetKeyFromCode(AK_RET);PreSpec=AK_UP;
				break;
				case AK_NP7 :
					CurrentSelection=GetKeyFromCode(AK_RET);PreSpec=AK_NP7;
				break;
				case AK_ENT :
					CurrentSelection=GetKeyFromCode(PreSpec);
				break;
				default :
					if(CurrentSelection>0) --CurrentSelection;
					if(AmigaKeyboard[CurrentSelection].x1>AmigaKeyboard[CurrentSelection+1].x1) ++CurrentSelection;
				break;
			}
		break;
		case 0 :	// Up
			if(CurrentSelection==SPECIAL_CODE_FOR_ENTER)
			{
				if((PreSpec==AK_QUOTE)||(PreSpec==AK_UP)||(PreSpec==AK_RSH)||(PreSpec==AK_BS)) CurrentSelection=GetKeyFromCode(AK_BS);
				if(PreSpec==AK_RBRACKET) CurrentSelection=GetKeyFromCode(AK_RBRACKET);
				if(PreSpec==AK_BACKSLASH) CurrentSelection=GetKeyFromCode(AK_BACKSLASH);
				break;
			}
			switch(AmigaKeyboard[CurrentSelection].AmigaKeyCode)
			{
				case AK_RSH :
					CurrentSelection=GetKeyFromCode(AK_RET);PreSpec=AK_RSH;
				break;
				case AK_UP :
				case AK_LF :
					CurrentSelection=GetKeyFromCode(AK_DEL);
				break;
				case AK_RT :
					CurrentSelection=GetKeyFromCode(AK_HELP);
				break;
				case AK_NP0 :
					if(AmigaKeyboard[PreSelect].y1<AmigaKeyboard[GetKeyFromCode(AK_NP0)].y1)
						CurrentSelection=PreSelect;
					else
						CurrentSelection=GetKeyFromCode(AK_NP1);
				break;
				case AK_SPC :
					if(AmigaKeyboard[GetKeyFromCode(PreSpec)].y1<AmigaKeyboard[CurrentSelection].y1)
						CurrentSelection=GetKeyFromCode(PreSpec);
					else
						CurrentSelection=GetKeyFromCode(AK_B);
				break;
				default :
					while(CurrentSelection>0)
					{
						--CurrentSelection;
						if((AmigaKeyboard[CurrentSelection].y1<AmigaKeyboard[PreSelect].y1)&&(AmigaKeyboard[CurrentSelection].x1<AmigaKeyboard[PreSelect].x2)) break;
					}
					if((CurrentSelection==0)&(PreSelect!=CurrentSelection)) CurrentSelection=PreSelect;
				break;
			}
		break;
		case 2 :	// Down
			if(CurrentSelection==SPECIAL_CODE_FOR_ENTER)
			{
				CurrentSelection=GetKeyFromCode(AK_RSH);
				break;
			}
			switch(AmigaKeyboard[CurrentSelection].AmigaKeyCode)
			{
				case AK_BS :
					CurrentSelection=GetKeyFromCode(AK_RET);PreSpec=AK_BS;
				break;
				case AK_BACKSLASH :
					CurrentSelection=GetKeyFromCode(AK_RET);PreSpec=AK_BACKSLASH;
				break;
				case AK_RBRACKET :
					CurrentSelection=GetKeyFromCode(AK_RET);PreSpec=AK_RBRACKET;
				break;
				case AK_DEL :
				case AK_HELP:
					CurrentSelection=GetKeyFromCode(AK_UP);
				break;
				case AK_LF :
					CurrentSelection=GetKeyFromCode(AK_RALT);
				break;
				case AK_NP3 :
					CurrentSelection=GetKeyFromCode(AK_NPDEL);
				break;
				default :
					while(AmigaKeyboard[(CurrentSelection+1)].AmigaKeyCode!=-1)
					{
						++CurrentSelection;
						if((AmigaKeyboard[CurrentSelection].y1>AmigaKeyboard[PreSelect].y1)&&(AmigaKeyboard[CurrentSelection].x2>AmigaKeyboard[PreSelect].x1)) break;
					}
					if(AmigaKeyboard[(CurrentSelection+1)].AmigaKeyCode==-1) CurrentSelection=PreSelect;
				break;
			}
			if((AmigaKeyboard[CurrentSelection].AmigaKeyCode==AK_SPC)&&(CurrentSelection!=PreSelect)) PreSpec=AmigaKeyboard[PreSelect].AmigaKeyCode;
		break;
	}
	if(SolidKeyboard)
		DrawKeyboardD();
	else
		DrawKeyboard();		
}

void KeyPressed(void)
{
	if(CurrentSelection!=SPECIAL_CODE_FOR_ENTER)
		record_key((AmigaKeyboard[CurrentSelection].AmigaKeyCode)<<1);
	else
		record_key(AK_RET<<1);
}

void KeyReleased(void)
{
	if(CurrentSelection!=SPECIAL_CODE_FOR_ENTER)
		record_key(((AmigaKeyboard[CurrentSelection].AmigaKeyCode)<<1)|1);
	else
		record_key((AK_RET<<1)|1);
}

